import React from 'react'

class Nav extends React.Component {
  render() {
    return (
      <div>
        <h3>BARBERs</h3>
       <nav className='text-white'>
          <a href="" className='text-white'>HOME</a>
          <a href="" className='text-yellow'>About Us</a>
          <a href="">Services</a>
          <a href="">Testimonials</a>
          <a href="">Our Team</a>
          <a href="">Contact Us</a>
       </nav>
      </div>
    );
  }
}

export default Nav
